import React from 'react'

function Profile({response}) {
    var artistname = '';
    var artistimage = '';

    if(response !== null){
        artistname = response.data.data[0].artist.name;
        artistimage = response.data.data[0].artist.picture;
    }
    
    return (
        <div>
            <img src={artistimage} alt=""/>
        </div>
    )
}

export default Profile
